// A character will be used as the delimeter to let users
// replace the emote after they type it via a key.
// A user may also hold down the shift key while
// typing the delimeter to not replace the emote.
var DELIMETER_CHAR = ' ';
var DELIMETER_KEYS = {
    '32': false, // space
    '93': false, // ]
    '58': true, // :
};

// Remove delimeter char from end of emote.
var removeDelimRegexp = new RegExp(DELIMETER_CHAR + '$');

// Remove signature.
var removeSigRegexp = /\n---(\n.+){1,2}$/;

// Apply this functionality to all textareas.
var textarea = document.getElementsByName('message')[0];

function searchAndReplace(e) {
    var code = e.keyCode || e.charCode;
    if (DELIMETER_KEYS[code] === !!e.shiftKey) {
        var text = textarea.value;
        
        // Remove the signature;
        var sig = '';
        text = text.replace(removeSigRegexp, function(match) {
            sig = match;
            return '';
        });
        
        // Check the position of the cursor so that that
        // it only replaces the last emote typed.
        var pos = textarea.selectionStart;
        
        // If typing inside the signature, don't replace;
        if (pos > text.length) {
            return;
        }
        
        // Search only until the cursor position;
        var afterText = text.slice(pos);
        text = text.slice(0, pos);
        
        // Only search one line.
        var charpos = text.lastIndexOf('\n');
        var offset = 0;
        var beforeText = '';
        if (charpos !== -1) {
            charpos += 1;
            offset = charpos;
            beforeText = text.slice(0, charpos);
            text = text.slice(charpos);
        }
        
        // Only check the word after the last space, if any.
        charpos = text.lastIndexOf(' ');
        if (charpos !== -1) {
            charpos += 1;
            offset += charpos;
            beforeText += text.slice(0, charpos);
            text = text.slice(charpos);
        }
        
        // Add delimeter to end.
        if (code !== 32) {
            text += String.fromCharCode(code);
        }
        
        if (Object.prototype.hasOwnProperty.call(emotes, text)) {
            var img = emotes[text];
            offset += img.length + 1;
            text = img + DELIMETER_CHAR;
            
            // Add back the signature and any previous text.
            textarea.value = beforeText + text + afterText + sig;
            
            // Move the cursor to the right spot.
            textarea.selectionEnd = offset;
            textarea.selectionStart = offset;
            
            // Cancel typing of the character.
            e.preventDefault();
        }
    }
}

textarea.addEventListener('keypress', searchAndReplace);